import {Route, Switch} from 'react-router-dom';
import Comments from './components/comments/Comments';
import CommentList from './components/comments/CommentsList';

function App() {
  return (
    <div>

        <Route path="/" exact>
           <Comments />
        </Route>
        <Route path="/Comments" exact>
           <CommentList />
        </Route>
    </div>
  );
}

export default App;
